                "about.v2.block1.title": "Learn, Play and Give Back with Freerice!",
                "about.v2.block1.paragraph1.part1": "Freerice is an educational trivia game that helps you get smarter while making a difference for people around the world. Every question you answer correctly in the gametriggers a financial payment to the",
                "about.v2.block1.paragraph1.link1": "World Food Programme (WFP)",
                "about.v2.block1.paragraph1.part2": "to support its work saving and changing lives around the world.",
                "about.v2.block1.paragraph2.part1": 'In the game, these payments are represented by grains of rice so by playing Freerice, you are generating the money that pays for this rice. This money goes into the pot of "greatest needs" to support WFP\'s ongoing',
                "about.v2.block1.paragraph2.link1": "emergencies",
                "about.v2.block1.paragraph2.part2": ". 100% of all funds generated on Freerice go to the World Food Programme. Freerice does not earn or keep any money it raises.",
                "about.v2.block1.paragraph3.part1": "Since 2010, Freerice has raised more than 210 billion grains of rice for people in need. In cash equivalent, that is US $1.41 million! Join our community of 500,000 players from around the world and start making a difference today.",
                "about.v2.block2.title": "What is the World Food Programme?",
                "about.v2.block2.paragraph1.part1": "The United Nations World Food Programme (WFP) is the 2020 Nobel Peace Prize Laureate. We are the world\u2019s largest humanitarian organization, delivering life-saving food assistance in emergencies and working with vulnerable communities to improve nutrition and build resilience. Each year, 100 million people receive WFP assistance in 80+ countries around the world.",
                "about.v2.block3.title": "How can I use Freerice in the classroom or in my workplace?",
                "about.v2.block3.subtitle1": "Create a group!",
                "about.v2.block3.paragraph1.part1": 'Once you have created a profile, you can create a private group, invite your friends and compete to see who can raise the most rice! Share your group code so players can join. Then track rice grains in the groups "stats" page to see the rankings of the players. Any rice grains you earn through your individual profile is automatically added into the group.',
                "about.v2.block3.subtitle2": "Engage your followers!",
                "about.v2.block3.paragraph2.part1": "Engage your social media followers by hosting #TriviaTuesday! Create quizzes in Instagram Stories and choose a new theme each week. Tag @",
                "about.v2.block3.paragraph2.link1": "wfpfreerice",
                "about.v2.block3.paragraph2.part2": " so we can repost you! You can also host a virtual volunteer events to mark key international days, like World Food Day or the International Day of Charity.",
                "about.v2.block4.title": "Where do the ads come from?",
                "about.v2.block4.paragraph1.part1": "WFP does not endorse any company, product or service, including any represented by any advertisement you may see on Freerice. Advertisements on Freerice come via an ad exchange called The Rubicon Project. Advertisers do not enter into any contractual relationship or partnership with Freerice or the World Food Programme in advance.",
                "about.v2.block4.paragraph2.part1": "Freerice has an extensive list of banned industries and advertisers but if you ever see an advertisement that is inappropriate, please email",
                "about.v2.block4.paragraph2.link1": "WFP.Freerice@wfp.org",
                "about.v2.block4.paragraph2.part2": "so we can take immediate action to ban the advertiser in question.",
                "about.v2.block4.paragraph3.part1": "The first time you visit Freerice.com or open the app, you will be asked to give your consent to see personalized advertisements.",
                "about.v2.block4.paragraph3.link1": "You can change your settings and disable this at any time.",
                "about.v2.block5.title": "What if I am not seeing any advertisements?",
                "about.v2.block5.paragraph1.part1": "Every time you answer a question right, Freerice tries to show you an advertisement that will generate a payment.",
                "about.v2.block5.paragraph2.part1": "Please check that you aren\u2019t running any ad blocking software in your browser or on your phone. If you are, make sure you whitelist the entire freerice.com domain. If you\u2019re using our mobile apps, you can also check in your settings that the \u201climit ad tracking\u201d option is not turned on.",
                "about.v2.block5.paragraph3.part1": "Sometimes, depending on a variety of factors (including time of day, location, phone/browser settings, or variances in the ad market), there is no advertisement available to show you. When this happens, Freerice will show you an \u2018in-house\u2019 ad which does not generate any payment.",
                "about.v2.block5.paragraph4.part1": "But this doesn\u2019t mean your effort is wasted. Some advertisements bring in more money than the equivalent of 10 grains, meaning up to 20, 30 or even 40 grains can be purchased, which compensates for those times that some players don\u2019t see a paying advertisement. On average, across all players, Freerice always generates at least the cash equivalent of 10\xa0grains of rice for every right answer in the game.",
                "about.v2.block6.title": "Community Guidelines",
                "about.v2.block6.paragraph1.part1": "Freerice is a game for all ages and is designed to be safe, welcoming, and neutral. We are a community of players who want to learn, play, and make a positive difference in the world. We come from all over the world, and we have different beliefs. We have to keep that in mind when we share the Freerice space together.",
                "about.v2.block6.paragraph2.part1": "Your username and group name are the two places where players can submit information that is visible to other players. Please keep in mind that",
                "about.v2.block6.paragraph2.part2": "we don\u2019t allow usernames or group names that make offensive, upsetting, or controversial statements, including political protest or political satire.",
                "about.v2.block6.paragraph3.part1": "If your username or group name is doing this, we will change it to \u201cName Changed \u2014 See the About Page for Community Guidelines\u201d, at which point you should change it to something else.",
                "about.v2.block6.paragraph4.part1": "To protect your data, we do not save your email address in a way that is accessible to us when you sign up, so",
                "about.v2.block6.paragraph4.part2": "we cannot contact you to tell you",
                "about.v2.block6.paragraph4.part3": "\xa0if we have changed your username or group name for violating the guidelines.",
                "about.v2.block7.title": "Contact Us",
                "about.v2.block7.paragraph1.part1": "If you have any other questions, please contact us at",
                "about.v2.block7.paragraph1.link1": "WFP.Freerice@wfp.org",
                "about.v2.block7.paragraph2.part1": "Follow us on ",
                "about.v2.block7.paragraph2.link1": "Facebook",
                "about.v2.block7.paragraph2.part2": ",",
                "about.v2.block7.paragraph2.link2": "Instagram",
                "about.v2.block7.paragraph2.part3": "and",
                "about.v2.block7.paragraph2.link3": "Twitter",
                "about.v2.block7.paragraph2.part4": ".",
