                "ageVerif.age.text": "\u0646\u0633\u062a\u062e\u062f\u0645 \u062a\u0627\u0631\u064a\u062e \u0645\u064a\u0644\u0627\u062f\u0643 \u0644\u0646\u0639\u0631\u0636 \u0644\u0643 \u0625\u0639\u0644\u0627\u0646\u0627\u062a \n \u062a\u0646\u0627\u0633\u0628 \u0639\u0645\u0631\u0643. \n\n\u0644\u0627 \u0646\u062d\u062a\u0641\u0638 \u0628\u062a\u0627\u0631\u064a\u062e \u0645\u064a\u0644\u0627\u062f\u0643 \n \u0641\u064a \u0633\u062c\u0644\u0627\u062a\u0646\u0627 \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642.",
