                "appscontent.web.title": "\u064a\u0645\u0643\u0646 \u0627\u0644\u0622\u0646 \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u062a\u0637\u0628\u064a\u0642 \u0639\u0644\u0649 \u0647\u0648\u0627\u062a\u0641 \u0622\u064a\u0641\u0648\u0646 \u0648\u0646\u0638\u0627\u0645 \u0623\u0646\u062f\u0631\u0648\u064a\u062f",
